pragma solidity ^0.4.11;
    
import "./DHFBaseCurrency.sol";

contract LotteryPowerball is DHFBaseCurrency {
    
    bool isRunning = false;
    
    uint public jackPot = 0; //  
    uint public regularPrize = 0; //   
    uint public ticketPrice = 40; //  
    uint public jackPotAssignment = 40; //    -   
    uint public regularPrizeAssignment = 40; //     
    uint8 public maxWhiteBallNumberInTicket = 69; //  ,     
    uint8 public maxRedBallNumberInTicket = 26; //  ,     
    uint8 public prizeCombinationSize = 6;//    
    uint8 public maxBallsInTicket = 6;//    
    
    uint32 public lastLotteryId = 0; //   
    //  
    struct PowerballTicket {
        address owner; // 
        string time; //    
        uint8[6] balls; //   5  , 6   
        uint8[2] complianceLevel; //     ,  -   
        uint money;//   
    }
    
    struct PowerballLottery {
        string date; //   
        mapping(uint => PowerballTicket) tickets; //   .
        uint ticketsCount; //    
        uint[6] prizeCombination; //     
    }
    //  
    mapping (uint => PowerballLottery) public historyPowerballLotteries;
    //   
    PowerballLottery currentPowerballLottery;
    //  
    function LotteryPowerball() DHFBaseCurrency (10000, "Lottery Powerball", "LP") public { 
        
    }
    //  
    function startLottery() private onlyOwner {
        isRunning = true;
    }
    //  
    function stopLottery() private onlyOwner {
        isRunning = false;
    }
    //     
    function isRunningLottery() public returns (bool res) {
        require(isRunning);
        return true;
    }
    
    function BuyTicket(uint8 firstWhiteBall, uint8 secondWhiteBall, uint8 thirdWhiteBall, uint8 fourWhiteBall, uint8 fiveWhiteBall, uint8 redBall) public returns (bool res) {
        return true;
    }
}
